import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import "./styles/SPA.css";
import About from "./About";
import OurCompanies from "./OurCompanies";
import Contact from "./Conctact";
import App from "../App";

function NavBar() {
	return (
		<Router>
			<div className="w3-bar w3-blue w3-large">
			
				<Link to="/companies" className="w3-bar-item w3-button w3-mobile">
					Our Companies
				</Link>
				<Link to="/about" className="w3-bar-item w3-button w3-mobile">
					About
				</Link>
				<Link className="w3-bar-item w3-button w3-mobile">Contact</Link>
				<Link className="w3-bar-item w3-button w3-hover-blue w3-center w3-mobile">
					<b>Bank of Singapore</b>
				</Link>
				<Link className="w3-bar-item w3-button w3-right w3-mobile">User</Link>
				<Routes>
					<Route path="/"><App /></Route>
					<Route path="/about"><About /></Route>
					<Route path="/companies"><OurCompanies /></Route>
					<Route path="/contact"><Contact /></Route>
				</Routes>
			</div>

		</Router>
	);
}
export default NavBar;
